import React from "react";
import { Table } from "react-bootstrap/Table";

function THead() {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>Employee</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Email</th>
        </tr>
      </thead>
    </Table>
  );
}

export default THead;
